import React from 'react';

import Container from 'react-bootstrap/Container';
import Image from 'react-bootstrap/Image'
import Nav from 'react-bootstrap/Nav'
import Navbar from 'react-bootstrap/Navbar'
import NavDropdown from 'react-bootstrap/NavDropdown'
import Card from 'react-bootstrap/Card'
import Button from 'react-bootstrap/Button'
import Dropdown from 'react-bootstrap/Dropdown'
import CardGroup from 'react-bootstrap/CardGroup'
import Toast from 'react-bootstrap/Toast'
import Carousel from 'react-bootstrap/Carousel'
import ToastContainer from 'react-bootstrap/ToastContainer'

import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter,
  Routes,
  Route,
  Link,
  Outlet
} from "react-router-dom";

class viewCats extends React.Component {

    constructor(props) {
      super(props);
      this.state = {
        chatList: []
      };

    } 

    componentDidMount() {
      Axios.get('http://localhost:8000/chats')
      .then((response) => {
        console.log(response.data);
        console.log(response.status);
        console.log(response.statusText);
        console.log(response.headers);
        console.log(response.config);
        this.setState({chatList: response.data})
      });
    }

    render() {
      return(
        <div className="container start" style={{maxWidth: "100%",maxHeight:"100%"}}>
            <Link to="/administration" class="link-light">  <Button variant="warning">Administration</Button> </Link>
            <Card style={{ width: '18rem' }}>
        <Card.Img variant="top" src="" />
        <Card.Body>
          <Card.Title>Card Title</Card.Title>
          <Card.Text>
            Some quick example text to build on the card title and make up the bulk of
            the card's content.
          </Card.Text>
          <Button variant="primary">Go somewhere</Button>
        </Card.Body>
      </Card>
        </div>
      );
    }
  }

export default viewCats;
